import React, { useState, useEffect, Component } from "react";
import "./SkillSet.scope.css";
import "./saturn.scope.css"
import { Controller, Scene } from 'react-scrollmagic';
import { Tween } from 'react-gsap';

const SkillSlider = () => {


  return (
    <section className="container-page" id='skillset'>
      <div className="spacer s2"></div>
      <div id="trigger1" className="spacer s0"></div>
      <Controller>
        <Scene triggerElement="#trigger1">
          {(progress) => (
            <Tween
              from={{ backgroundColor: '#fff', scale: 1 }}
              to={{ backgroundColor: 'green', scale: 2.5 }}
              duration={0.5}
            >
              <div id="animate1" className="box2 skin">
                <p>You wouldn't like me, when I'm angry!</p>
                <a href="#" className="viewsource">
                  view source
                </a>
              </div>
            </Tween>
          )}
        </Scene>
      </Controller>
      <div className="spacer s2"></div>
    </section>
  );
};

export default SkillSlider;
